import Pagination from "@/components/Pagination";
export default {
  name: "Hand_pulled_material",
  components: {
    Pagination: Pagination
  },
  data: function data() {
    return {
      theight: 0,
      sheight: 0,
      isSingle: true,
      //表格是否单选 点击各按钮根据流程逻辑控制单多选
      currentSelectedRow: null,
      //当前选中的行
      selectedRows: null,
      //多选时选中的所有行
      list: null,
      listDetail: null,
      listDetailSub: null,
      total: 0,
      totals: 0,
      rangeTime: "",
      accountRangeTime: "",
      selectRows: [],
      businessTypeList: [],
      supplierRows: [],
      listQuery: {
        page: true,
        currentPage: 1,
        pageSize: 10,
        orgCode: '',
        warehouseCode: '',
        dicType: ''
      },
      sublistQueryf: {
        page: true,
        currentPage: 1,
        pageSize: 10,
        method: 'proofDetai'
      },
      sublistQuerys: {
        page: true,
        currentPage: 1,
        pageSize: 10,
        method: 'processingDetail'
      },
      tableKey: 0,
      dialogPrintVisible: false,
      printData: {},
      //打印数据
      printList: []
    };
  },
  filters: {},
  mounted: function mounted() {
    var _this = this;

    this.setTableHeight(); //表格高度自适应

    window.onresize = function () {
      _this.setTableHeight();
    };
  },
  methods: {
    //表格高度计算
    setTableHeight: function setTableHeight() {
      this.theight = this.$myFun.getSingleTbHeight() + 53;
      this.sheight = (this.$myFun.getSingleTbHeight() - 33) / 2;
    },
    //主表数据获取
    getList: function getList() {
      if (this.rangeTime) {
        var d1 = this.rangeTime[0];
        var d2 = this.rangeTime[1];
        this.listQuery.createDateBegin = d1;
        this.listQuery.createDateEnd = d2;
      } else {
        this.listQuery.createDateStart = null;
        this.listQuery.createDateEnd = null;
      }

      if (this.accountRangeTime) {
        var _d = this.accountRangeTime[0];
        var _d2 = this.accountRangeTime[1];
        this.listQuery.accountDateBegin = _d;
        this.listQuery.accountDateEnd = _d2;
      } else {
        this.listQuery.accountDateBegin = null;
        this.listQuery.accountDateEnd = null;
      }
    },
    //查询
    handleQuery: function handleQuery() {
      this.listRow = [];
      this.listQuery.currentPage = 1;
      this.getList();
    },
    //每页大小变化
    handleSizeChange: function handleSizeChange(val) {
      this.listQuery.pageSize = val;
      this.getList();
    },
    //当前页变化
    handleCurrentChange: function handleCurrentChange(val) {
      this.listQuery.currentPage = val;
      this.getList();
    },
    // 表格选择框选中 注:参数为选中的所有行的数组
    selectChange: function selectChange(val) {
      if (this.isSingle) {
        if (val.length > 1) {
          this.$refs.tb.clearSelection(); //清除其他行的选中

          this.$refs.tb.toggleRowSelection(val[val.length - 1], "selected"); //单击行绑定点击事件
        } else if (val.length === 1) {
          this.selectedRows = val;
          this.currentSelectedRow = val[val.length - 1];
        }
      } else {
        this.selectedRows = val;
        this.currentSelectedRow = val[val.length - 1];
      }
    },
    //点击表格某一行
    rowClick: function rowClick(val) {
      if (this.isSingle) {
        this.$refs.tb.clearSelection(); //清除其他行的选中
      }

      this.$refs.tb.toggleRowSelection(val, "selected"); //单击行绑定点击事件

      this.getSubList(val);
    },
    //显示从表
    getSubList: function getSubList() {},
    //打印
    handlePrint: function handlePrint() {},
    //导出
    handleExport: function handleExport() {}
  }
};
